import { createRouter, createWebHistory } from 'vue-router';
import AppUserLayout from '../componentsUser/AppLayout.vue';
import AppAdminLayout from '../components/Admin/AppAdminLayout.vue';

const userRoutes = [
    { path: '/', component: () => import('../componentsUser/AppHome.vue') },
    { path: '/services/badges', component: () => import('../componentsUser/AppBadge.vue') },
];

const adminRoutes = [
    { path: '/', component: () => import('../components/Admin/AppAdminHome.vue') },
    { path: '/users', component: () => import('../components/Admin/AppAdminUsers.vue') },
];

const routes = [
    { 
        path: '/user',
        component: AppUserLayout,
        children: userRoutes
    },
    { 
        path: '/admin',
        component: AppAdminLayout,
        children: adminRoutes
    },
];

const router = createRouter({
    history: createWebHistory(),
    routes
});

export default router;

